import React from "react";
import LabelOneField from "./LabelOneField";
import LabelTwoFields from "./LabelTwoFields";
import LabelThreeFields from "./LabelThreeFields";

function ExclusiveInitInfo( {nameBox} ){
    return(
        <div>
            <h3>{nameBox}</h3>
            <div className="form-box">
                <div className="birth-data">
                    <div className="one-field-container">
                    <label>Fecha de nacimiento: </label>
                    <DateTime className="date-time-props"
                    name="birth-date"
                    inputProps={{ placeholder: "dd/mm/aaaa" }}
                    dateFormat="DD/MM/YYYY"
                    timeFormat={false}
                    />
                    </div>
                    <div className="one-field-container">
                    <label>Lugar de Nacimiento:</label>
                    <input name="place-birth" type="text" placeholder="Lugar de nacimiento"></input>
                    </div>  
                </div>
                <LabelTwoFields
                    labelText={"Cargo"}
                    inputId={""}
                    inputPlaceholder={"Ingrese el cargo del empleado"}
                    inputType={"text"}

                    labelText2={"Cargo"}
                    inputId2={""}
                    inputPlaceholder2={""}
                    inputType2={"text"}
                />
            </div>
        </div>
    );
}
